from typing import List


class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        # SOL 2 - much faster if we start two pointers in two directions
        lo, hi = 0, len(numbers)-1
        while(lo<hi):
            s = numbers[lo]+numbers[hi]
            if s == target:
                return [lo+1, hi+1]
            elif s > target:
                hi -= 1
            else:
                lo += 1
        # SOL 1 - worked, but too slow to even pass test case within required time
